	return (
		<>
			<div className="item">
				<div className="category-item">
					<a href="#">
						<img
							className="img-fluid custom-slick-img"
							src={categories[0].images[0].src}
							alt="this img"
						/>
						<h6>
							 
						</h6>
						<p> </p>
					</a>
				</div>
			</div>
		</>
	);
}
